import React from 'react'
import { getTodayDate } from '../../utils'

function index() {

    const data = getTodayDate();

    return (
        <div>
            <form>
  <label>
    Name:
    <input type="text" name="name" />
  </label>
  <input type="submit" value="Submit" />
</form>
            <h3>HELLO MOTHERFUCKER</h3>
            <h1>{data}</h1>
        </div>
    )
}
export default index;
